import React from 'react';
import s from './Reviews.module.css';
import Slider from 'react-slick';
import review1 from '../../images/reviewsImage/review1.png';
import review2 from '../../images/reviewsImage/review2.png';
import review3 from '../../images/reviewsImage/review3.png';
import review4 from '../../images/reviewsImage/review4.png';
const Reviews = ()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'82px'
    };
    return(
<Slider {...settings} className={s.reviewSlider}>
<div>
    <img src={review1}></img>
   <a href='#'> <p className={s.review1}>@emelina_vera</p></a>
</div>
<div>
<img src={review2}></img>
</div>
<div>
<img src={review3}></img>
</div>
<div>
<img src={review4}></img>
</div>
</Slider>
    );
};

export default Reviews;
